import Link from 'next/link';

const linkStyle = {
    margin: 20,
    fontSize: 30,
    fontFamily: 'Roboto',
    fontWeight: 700,
    textDecoration: 'none',
    color: black
  };
 
const barStyle = {
    padding: '2.5vh',
    textAlign: 'center'
}

  const Navbar = () => (
    <div style={barStyle}>
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>About</a>
      </Link>
    </div>
    
  );
  
  export default Navbar;
